import React from 'react';
import Room from './Room';
import {Row} from "react-bootstrap";

function render(){
   return(
        <Room/>
   ); 
}
function RoomList(){
    ReactDOM.render(<Room/>, document.getElementById("page-landing")); 
    return(
        <div>
            <Row>
                <Room/>
            </Row>
            <Row>
                <Room/>
            </Row>
            <Row>
                <Room/>
            </Row>
            <Row>
                <Room/>
            </Row>
            <Row>
                <Room/>
            </Row>
            <Row>
                <Room/>
            </Row>
            <Row>
                <Room/>
            </Row>
        </div>
    );
}

export default RoomList
